import React from 'react';
import { Link } from 'react-router-dom';
import axios  from 'axios';
import {useState, useEffect } from 'react';


export default function UVehicles(){

    const [vehicle, setVehicles] = useState([]);

  const getVehicle = () => {
    axios.get('http://localhost:6060/Vehicle/')
      .then((res) => {
        console.log(res.data);
        setVehicles(res.data);
      })
      .catch((err) => {
        alert(err.message);
      });    
      
  };

  

  useEffect(() => {
    getVehicle();
    
  }, []);

    return(
    <div>
      <nav style={{ background: "#333333" }} className="navbar navbar-expand-lg navbar-light">
        <a style={{marginLeft:"10px",color:"whitesmoke",fontStyle:"italic",fontSize:"26px"}} className="navbar-brand" href="#">car<span style={{color:"#fe5b29"}}>H</span>ub</a>
      <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
        <span className="navbar-toggler-icon"></span>
      </button>
      <div className="collapse navbar-collapse" id="navbarNav">
        <ul className="navbar-nav">
          <li className="nav-item active">
            <a style={{color:"whitesmoke"}} className="nav-link" href="/index/:id">Home <span className="sr-only">(current)</span></a>
          </li>
          <li className="nav-item">
            <a style={{color:"whitesmoke"}} className="nav-link" href="/vehi">Vehicles</a>
          </li>
          <li className="nav-item">
            <a style={{color:"whitesmoke"}}  className="nav-link" href="#">about Us</a>
          </li>
          <li className="nav-item">
            <a style={{color:"whitesmoke"}} className="nav-link" href="#">Contact Us</a>
          </li>
        </ul>
      </div>
    </nav>
        <div class="search_section">
         <div class="container">
            <div class="row">
               <div class="col-md-12">
                  <h1 class="search_taital">Pick Up Your Best Car</h1>
                  <p class="search_text">Using 'Content here, content here', making it look like readable</p>
               </div>
            </div>
         </div>
      </div>

      <div class="gallery_section layout_padding">
         <div class="container">
            <div class="row">
               <div class="col-md-12">
                  <h1 class="gallery_taital">All Vehicles</h1>
               </div>
            </div>
            {vehicle.reduce((rows, v, index) => {
               if (index % 3 === 0) rows.push([]);
               rows[rows.length - 1].push(v);
               return rows;
            }, []).map((rowVehicles, rowIndex) => (
               <div class="row" key={rowIndex}>
               {rowVehicles.map((v, index) => (
                  <div class="col-md-4" style={{marginBottom:"26px"}}key={index}>
                     <div class="gallery_box">
                     <div style={{height:"250px"}} class="gallery_img">
                        <img src={`http://localhost:6060/images/${v.image}`} alt="Vehicle" />
                     </div>
                     <h3 class="types_text">{v.model}</h3>
                     <p class="looking_text">Start per day: {v.priceperday}</p>
                     <div class="read_bt">
                     <Link to={`/book/${v._id}`}>Book Now</Link>
                     </div>
                     </div>
                  </div>
               ))}
               </div>
            ))}
            
         </div>
      </div>
    </div>

    )
}
